import {BrowserRouter, Routes, Route, Router} from 'react-router-dom'

import Login from './pages/Login';
import Chat from './pages/Chat';
function App() {
  return (
    <Router>
        <Routes >
          <Route path="/" element={<Chat />}/>
          <Route path="/login" element={<Login />} />
        </Routes>
    </Router>

  );
}

export default App;
